import React from "react";
import GenModel from "./GenModel/GenModel";
/* import "./GenModelsHello.scss"; */


const GenModelsHello = (props) => {

 /* start test */
 props.gen_models.FrequencyType.variantType.map((x, index) => {
  return (
	console.log('x: ' + x + ' index: ' + index)
  );
})
 /* end test */

const genModel = props.gen_models.models.map((x, index) => {
  return (

      <GenModel
      key={x.id}
      genModelId={x.id} 
      genModelTitle={x.name} 
      genModelPackaging={x.packaging} 
      genModelPicture={x.pictureName}
      genModelIsActive ={x.isActive}
      />      
  );
})
  return (
    <>



    <div className="gen-models-filter__wrap">
        <h2>Quick Filter</h2>
        <form >
          <label>
            Name:
            <input type="text" value={props.gen_models.FrequencyType.selectedType} placeholder={props.gen_models.FrequencyType.placeholderType} />
          </label>
          <input type="submit" value="Submit" />
        </form>

        <hr>
        </hr>
        <label>
            Looping through Courses tag from Json File
            <select
              value={props.gen_models.FrequencyType.selectedType}

            >
              {props.gen_models.FrequencyType.variantType.map((value, index) => (
                <option key={index} value={value}>
                  {value}
                </option>
              ))}
            </select>
          </label>
        </div>

        <div className="gen-models__wrap">
        <h2>Generator Types</h2>
        <div className="gen-models">

        {genModel}

        </div>
        </div>    


      <div> <p>GenModelsHello Props:</p>
        <pre>{JSON.stringify(props, null, 2)}</pre>
      </div>

    </>
  );
};

export default GenModelsHello;
